import React, { useState } from "react";
import styled from 'styled-components'

const Header = (props) => {
  const [title, setTitle] = useState("");
  const [stringer, setStringer] = useState("");

  const Container = styled.div`
    max-width: 900px;
    margin: 0 auto;
    position: relative;
  `;

  return (
    <Container>
      <h1>{props.title}</h1>
    </Container>
  )
}

export default Header;
